/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function (s, t) {
  s = s.split('').sort();
  t = t.split('').sort();
  let result;

  console.log(s, t);

  for (let i = 0; i < s.length; i++) {
    if (s[i] !== t[i]) {
      s.length > t.length ? (result = s[i]) : (result = t[i]);
      return result;
    }
  }

  s.length > t.length ? (result = s[s.length - 1]) : (result = t[t.length - 1]);
  return result;
};

let s =
  '';
let t =
  '';
console.log(findTheDifference(s, t));
